std::vector<int> reachPosition(int n, int p, std::vector<int> &banned, int k) {
    std::set<int> banned_positions(banned.begin(), banned.end());
    std::vector<int> ans(n, 0);

    for (int i = 0; i < n; ++i) {
        if (banned_positions.find(i) != banned_positions.end() || i == p) {
            ans[i] = -1;
            continue;
        }

        int steps = 0;
        int an = abs(p - i) / k;
        if ((abs(p - i) % k == 0) && ((an & 1) == (((n - 1) & 1) ^ (k & 1)))) {
            steps = an;
        }
        else {
            steps = -1;
        }

        ans[i] = steps;
    }

    ans[p] = 0;
    return ans;
}
